import React, { useState } from "react";
import axios from 'axios';
import {useNavigate} from "react-router-dom";
 
export default function RegisterPage(){
    
    const [username,setUsername] = useState('');
    const [email,setEmail] = useState('');
    const [password,setPassword] = useState('');

    const [usernameError,setUsernameError] = useState('');
    const [emailError,setEmailError] = useState('');
    const [passwordError,setPasswordError] = useState('');

   
    const navigate = useNavigate();
     
    const registerUser = () => {
        let isValid = true


        if(username.length < 3 || username.length > 80){
            setUsernameError("Username must be at least 3 characters long.")
            isValid = false
          } else {
            setUsernameError("");
          }

        if(password.length === 6 || password.length > 80){
            setPasswordError("Password must be at least 6 characters long.")
            isValid = false
          } else {
            setPasswordError("");
          }


        if (!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(email)){
            setEmailError("Please enter a valid email.")
            isValid = false
        } else {
            setEmailError(""); 
        }


        if (!isValid) {
          axios.post('http://127.0.0.1:5000/sign-up', {
            username: username,
            email: email,
            password: password
        })
        .then(function (response) {
            console.log(response);
            navigate("/");
        })
        .catch(function (error) {
            console.log(error, 'error');
            if (error.response && error.response.status === 400) {
              if (error.response.data.message === "Username already exists") {
                setUsernameError("Username already exists");
              }
              else if (error.response.data.message === "Email already exists") {
                setEmailError("Email already exists");
              }
            }
            


            if (error.response.status === 401) {
                alert("Invalid credentials");
            }
        });
        }

      
}
     
    // let imgs = [
    //   'https://as2.ftcdn.net/v2/jpg/03/39/70/91/1000_F_339709132_H9HSSTtTmayePcbARkTSB2qoZTubJ6bR.jpg',
    // ];
     
  return (
    <div>
        <div className="container h-100">
          <div className="container-fluid h-custom">
            <div className="row d-flex justify-content-center align-items-center h-100">
              <div className="col-md-8 col-lg-6 col-xl-4 offset-xl-1">
                <form>
                  <div className="d-flex flex-row align-items-center justify-content-center justify-content-lg-start">
                    <p className="lead fw-normal mb-1 me-3">Create Your Account</p>
                  </div>

                  <div className="form-outline mb-3">
                    <input type="username" value={username} onChange={(e) => setUsername(e.target.value)} id="form3Example5" className="form-control form-control-lg" placeholder="Enter Username" />
                    <label className="form-label" for="form3Example4">Username</label>
                  </div>
 
                  <div className="form-outline mb-4">
                    <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} id="form3Example3" className="form-control form-control-lg" placeholder="Enter a valid email address" />
                    <label className="form-label" for="form3Example3">Email address</label>
                  </div>
 
             
                  <div className="form-outline mb-3">
                    <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} id="form3Example4" className="form-control form-control-lg" placeholder="Enter password" />
                    <label className="form-label" for="form3Example4">Password</label>
                  </div>
 
                  <div className="d-flex justify-content-between align-items-center">
                    <div className="form-check mb-0">
                      <input className="form-check-input me-2" type="checkbox" value="" id="form2Example3" />
                      <label className="form-check-label" for="form2Example3">
                        Remember me
                      </label>
                    </div>
                    <a href="#!" className="text-body">Forgot password?</a>
                  </div>
 
                  <div className="text-center text-lg-start mt-4 pt-2">
                    <button type="button" className="btn btn-primary btn-lg" onClick={() => registerUser()} >Sign Up</button>
                    <p className="small fw-bold mt-2 pt-1 mb-0">Login to your account <a href="/login" className="link-danger">Login</a></p>
                  </div>
 
                </form>
              </div>
              {/* <div className="col-md-9 col-lg-6 col-xl-5">
                <img src={imgs[0]} className="img-fluid"/>
              </div> */}
            </div>
          </div>
        </div>
    </div>
  );
}
